script: |
  super -f tsv -I q8932.sql | sort > q8932.out

vector: true

inputs:
  - name: q8932.sql
    data: |
      SELECT NULLIF ( cor0.col1, cor0.col1 * 4 + - col1 ) * + cor0.col0 AS col1 FROM tab0 AS cor0 GROUP BY cor0.col0, cor0.col1, cor0.col1;
  - name: tab0

outputs:
  - name: q8932.out
    data: |
      3483
      NULL
      NULL
